import Axios from 'axios'
import { useState } from 'react';
import './websitepassform.css'

const firebase = require('firebase');


const firebase_app = firebase.initializeApp({
    apiKey: "AIzaSyBbPfxb9WHvag2T2Q1svoMVAYqqY74ecNU",
    authDomain: "password-manager-e738c.firebaseapp.com",
    databaseURL: "https://password-manager-e738c-default-rtdb.firebaseio.com",
    projectId: "password-manager-e738c",
    storageBucket: "password-manager-e738c.appspot.com",
    messagingSenderId: "992983353719",
    appId: "1:992983353719:web:4b96ba80ba44f9366b7972",
    measurementId: "G-EQEDQWMDB0"
});

function PassForm() {


  const [password,setpassword] = useState('');
  const [title,settitle] = useState('');

 const addPassword = () => {
  Axios.post('http://localhost:3001/addpassword', {password: password, title: title});

  

 }
 function signout(){
    firebase.auth().signOut().then(() => {
        console.log("successful");
      }).catch((error) => {
        // An error happened.
        console.log("error");
      });
 }
 return <div className="Appy">
    <div className="AddingPassword">
      <input type="text" placeholder="Example pass123" onChange={(event) => { setpassword(event.target.value)}}/>
      <input type="text" placeholder="Example www.facebook.com" onChange={(event) => { settitle(event.target.value)}} />
      <button onClick={addPassword}>Add Password </button>
      <button onClick={signout}>Signout </button>
    </div>
  </div>;
}

export default PassForm;
